// src/components/PageLayout.jsx
import React from 'react';
import Navbar from './Navbar';
import HeroSection from './HeroSection';
import PhotoGallery from './PhotoGallery';
import Footer from './Footer';
import '../styles/layout.css';

const PageLayout = ({ title, subtitle, showHero = true, showGallery = true, showFooter = true, children }) => {
  return (
    <div className="page-layout bg-black text-gold">
      {/* âœ… Container 1: Navbar with multicolor border */}
      <div className="multicolor-border">
        <Navbar />
      </div>

      {/* âœ… Container 2: Hero Section */}
      {showHero && (
        <div className="multicolor-border">
          <HeroSection title={title} subtitle={subtitle} />
        </div>
      )}

      {/* âœ… Container 3: Logo Section with video background */}
      <div className="multicolor-border logo-section">
        <video
          autoPlay
          muted
          loop
          className="background-video"
          style={{ position: 'absolute', width: '100%', height: '100%', objectFit: 'cover', zIndex: -1 }}
        >
          <source src="/videos/mavj-logo-bg.mp4" type="video/mp4" />
        </video>
        <img src="/images/MAVJLogo.jpg" alt="MAVJ Logo" className="logo-image" />
      </div>

      {/* âœ… Container 4: Centered Text/Intro Paragraph */}
      <div className="multicolor-border intro-paragraph text-center">
        <p>
          Welcome to My Alkaline Vegan Journey. Explore the vibrational blueprint of wellness, science, and community.
        </p>
      </div>

      {/* âœ… Container 5: Feature Grid (6 content boxes) */}
      <div className="multicolor-border">
        <div className="feature-grid">
          <div className="feature-box">
            <img src="/images/Journey2EnlightenmentBanner.jpg" alt="J2E" className="feature-image" />
            <h3>Journey 2 Enlightenment</h3>
          </div>
          <div className="feature-box">
            <img src="/images/MAVJStoreBanner.jpg" alt="Store" className="feature-image" />
            <h3>MAVJ Store</h3>
          </div>
          <div className="feature-box">
            <img src="/images/ConsultationsBanner.jpg" alt="Consult" className="feature-image" />
            <h3>Consultations</h3>
          </div>
          <div className="feature-box">
            <img src="/images/VibrationIntelligence.jpg" alt="VI" className="feature-image" />
            <h3>Vibrational Intelligence</h3>
          </div>
          <div className="feature-box">
            <img src="/images/RecipesBanner.jpg" alt="Recipes" className="feature-image" />
            <h3>Recipes</h3>
          </div>
          <div className="feature-box">
            <img src="/images/SponsorshipBanner.jpg" alt="Sponsor" className="feature-image" />
            <h3>Align With Us</h3>
          </div>
        </div>
      </div>

      {/* âœ… Container 6: Photo Gallery */}
      {showGallery && (
        <div className="multicolor-border">
          <PhotoGallery />
        </div>
      )}

      {/* âœ… Container 7: Footer */}
      {showFooter && (
        <div className="multicolor-border">
          <Footer />
        </div>
      )}
    </div>
  );
};

export default PageLayout;
